To learn about memory, we'll make a simplified version of the guessing game from the official Rust book. Start by opening your terminal and navigating to where-ever your creating you projects, just like last time, then we'll create a new project with: cargo new guessing-game Then we'll open the project go to the file src/main.rs. As before we'll see the same "hello, world" program: fn main() { println!("Hello, world!");
} Let's quickly change our hello world message to something that welcomes us to the game. #fn main() { println!("Welcome to the guessing game!");
#} And add another print line that tells the user what to expect #fn main() {
# println!("Welcome to the guessing game!"); println!("I have chosen a color red, green or blue, can you guess which?");
#} Let's pick a color that the user has to guess, I'm going to pick "blue" but feel free to pick your favourite Before we move on, I want to talk about the "type" of the data we've just created. We're going to cover types properly in the next video, but I want to quickly point some things out. The type of data describes a number of things but mainly, how that data is represented in memory and how it can be used. For example, is the data a string (like "blue"), or a number, or a boolean that represent true or false. As you can see, my editor has written colon ampersand str after actual. This isn't part of the text, it's just there to show me the "type" of the variable. This means that the variable actual contains a "reference" (represented by the &) to a "string slice" (represented by str). We'll talk about why the variable only contains a reference and not the data itself later. You could, if you like, manually write this yourself, however, it's generally better to let Rust infer the type, and only write it yourself if either Rust is unable to decide (because it could be multiple things) or in the case that Rust has a default type, you want to use something different. Anyway, back to the program: let's output the color so that we can see the program is working ok Great... but not much of a game is it, you don't even have time to guess before you're told what it is. Before we tell the user what the actual color was lets ask them to guess. In order to get some user input, we need to read from the terminal. When the program runs in the terminal, we can ask the user to type things. Regardless of whether you are on Windows, Mac or Linux, this input is passed into the program through a stream of data called standard in. Rust comes with a "standard library", the name is unrelated to the stream, they both just happen to be "standard" We can access the standard library as a module called std. I pronounce this S T D, but I think most people say "stud" and I should really start doing that. Modules in Rust are a way of grouping up other bits of code such as functions, data types and even other modules. We'll talk about them more in a future video. Inside of this is another module called io that deals with input and output. If we weren't using the println! macro, this is where we'd have to come to write things out to the terminal too, via a stream called stdout (standard out). println! is a nice little wrapper that makes writing to stdout pretty trivial. For completion's sake I should mention that, in addition to standard in and standard out, there is one more stream called standard error. This is also an output stream that we can use to separate informational output that is not part of the normal use of the program, whether that be errors or just information not directly relevant to the main output. stderr is really useful for things like logging, which we'll talk about in the future, but if you want to quickly write something to this stream you can use eprintln! and eprint! the same way we use println! and print! So, we get stdin using std::io::stdin(), this is a function call (we'll talk about functions in a couple of videos), that returns something called a "handle" that we can use for temporary access to the input stream. The double colons just tell Rust that we're looking for something inside a module. We'll cover modules in detail later, including how, why and when to make our own, as well as better ways to access them, but since we only need to write this line once, this is the easiest way to do it. We could store the result of stdin() in a variable, however, we only use this handle once, and then we're done with it. So, off the back of the function call, we can call immediately call .lines(). This is a method (a special type of function that belongs specifically to some other thing, in this case it belongs to the handle for stdin). .lines() returns an iterator, allowing us to iterate (or step through) each line one at a time. We get the next line by calling .next() on the iterator. Wait wait wait, what are those expects about?! expect() is, I would say, the second-worst way you could handle something going wrong in your program. This is not "idiomatic" and you absolutely should not use this in anything except the most throw away software as it will immediately cause the program to stop and spew a lot of information at the user. In the future we'll talk about things going wrong and how to better handle them, however, as this program is just for you, I think you'll cope for now. ðŸ˜Š That doesn't explain what these lines are doing, or why there are two of them though. The reason for this is that there are two possible ways .lines() might not work. The first expect then: .expect("No input was read") When we call .next() on any iterator, there either is something next or there isn't. In some languages this concept of something or nothing might be represented as either the data you wanted or null. For example, in another language we might ask for a string and get "red" or null. "red" is a string but null is not... what happens if you try to use the returned value as if it was a string? In languages with this behaviour might produce and error at the point where the data is used, not where it was generated, so you have to make sure to always check that your data is what it's supposed to be, which, the language isn't making an effort to remind you to do. Obviously many people think this ambiguity is bad, including Tony Hoare, arguably the "inventor" of this behavior, who has called it his "billion-dollar mistake". Rust does not allow you to use types like this interchangeably, so data can not be a string or null as these types are not compatible. In Rust, we use a kind of container type to get around this called Option. Option is an enum meaning its value is one of a set number of variants, in this case the variant is either Some or None If the variant of the Option is Some then it contains our value, otherwise it does not. Importantly, when a function returns an Option type you, the programmer, must check to see if it contains Some data and then extract the data if it's there. There are a number of ways to do this and .expect is one of the worst ways to do this. It will attempt to extract the data if its there, or stop the program abruptly with the provided error message if it's not. We'll talk about better ways to handle this in the future. For the time being we're going to just say we can't deal with it not being there, we don't want to continue running the program, and we want the program to stop. We use .expect("message") to say, if this is nothing, we are giving up, stop the program and print our message (plus a few other useful bits) to the stderr. You can see why this behaviour is typically undesirable but, we can allow it for this example, at least until we learn how to deal with Option properly. The second expect is a bit different: If the Option we got from .next() contains something instead of nothing, it still doesn't necessarily mean we read the users input correctly, reading data from standard in is itself fallible. Fallibility, the nature that something may go wrong, in programming is another thing we've traditionally handled very badly. A common way to deal with this in other languages is to stop executing and "throw" an error. The problem with throwing errors is that it breaks the flow of execution. Normally code is executed one line after another but once an error is thrown, the next thing to get executed after the throw is not obvious, it's going to be wherever the error is "caught"... if it's "caught". Sometimes you may not even realise that some code you've written could throw an error because you've called someone else's code, and they didn't make it obvious that their code could fail. Rust does away with this with another enum type called Result. If your function can fail, it must return a Result type. Like with Option, Result is its own type that contains either the data we wanted, or an error. The idiomatic way to handle Result types depends on what you're trying to do; could you recover from an error and keep the program running, how do we want to report the error back to the user, etc. Using expect will, again, cause the program to immediately stop with the error message sent to standard error, and again, you can see why this is typically extremely undesirable. For now, we'll make do with the two expects, and we have a working program. There is an actual color, the user guesses a color, and we print both to the screen.
